import React, { Component } from "react";
import List from "@material-ui/core/List";
import { withStyles } from "@material-ui/core/styles";
import Divider from "@material-ui/core/Divider";
import Card from "@material-ui/core/Card";

import Command from "./Command";

const styles = theme => ({
  root: {
    flexGrow: 1,
    maxWidth: 752
  },
  demo: {
    backgroundColor: theme.palette.background.paper
  },
  title: {
    margin: `${theme.spacing.unit * 4}px 0 ${theme.spacing.unit * 2}px`
  }
});

class CommandList extends Component {
  state = {
    dense: false,
    secondary: false,
    commands: [
      { command: "Shut the fuck up Sparky", action: "move" },
      { command: "Sparky you're a peice of shit", action: "move" },
      {
        command:
          "Even though I verbally abuse you, you're still my best friend Sparky, don't leave me",
        action: "priority"
      }
    ]
  };

  getCommands() {
    return this.state.commands;
  }
  render() {
    return (
      <Card>
        <List style={{ padding: 24, width: 500 }} dense={this.state.dense}>
          {this.state.commands.map(command => (
            <div>
              <Command action={command.action} data={command.command} />
              <li>
                <Divider variant="inset" />
              </li>
            </div>
          ))}
        </List>
      </Card>
    );
  }
}
export default withStyles(styles)(CommandList);
